// src/router/index.js - routes for project pages


import App from '@/App.vue';
import { createRouter, createWebHashHistory } from 'vue-router';
import PrintCardProject from '@/components/ProjectPrintCardProject.vue'

const routes = [
  { path: '/', name: 'App', component: App },
  { path: '/Projects/PrintCard',  name: 'PrintCard', component: PrintCardProject },
  { path: '/Projects/CardDesigner', name: 'CardDesigner', component: CardDesignerProject },
  { path: '/Projects/PortfolioWebsite', name: 'PortfolioWebsite', component: PortfolioWebsiteProject }
 ]

const router = createRouter({
  history: createWebHashHistory(),
  routes,
  scrollBehavior() {
    return { top: 0 }
  }
})

export default router
